import Header from "./components/header";
import MacroInputs from "./components/macroInputs";
import AppBody from "./components/caloriesExplanation";

function App() {
  return (
    <div className="App">
      <div className="">

      <Header />
      </div>

      <div className="app-body">
        <AppBody />
        <MacroInputs />
      </div>
    </div>
  );
}

export default App;
